// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Teste is Ownable {

    // Our Token Contract
    IERC20 public token;

    // Exchange rate (token amount per Ether) with 18 decimal precision
    uint256 public exchangeRate = 1e18; // Example: 1 Token = 1 Ether (1e18 represents 1 token per 1 ether)

    // Event that logs buy operations
    event BuyTokens(address indexed buyer, uint256 amountInEther, uint256 amountOfTokens);
    event Swap(address indexed user, uint256 amountOfToken, uint256 amountInEther);

    constructor(address tokenAddress) Ownable(msg.sender) {
        token = IERC20(tokenAddress);
    }

    /**
    * @notice Allow users to buy tokens with Ether
    */
    function buyTokens() public payable returns (uint256 tokenAmount) {
        require(msg.value > 0, "Send Ether to buy some tokens");

        uint256 amountToBuy = (msg.value * exchangeRate) / 1e18;

        // Check if the Vendor Contract has enough tokens for the transaction
        uint256 vendorBalance = token.balanceOf(address(this));
        require(vendorBalance >= amountToBuy, "Vendor contract has not enough tokens in its balance");

        // Transfer token to the msg.sender
        bool sent = token.transfer(msg.sender, amountToBuy);
        require(sent, "Failed to transfer token to user");

        // Emit the event
        emit BuyTokens(msg.sender, msg.value, amountToBuy);

        return amountToBuy;
    }

    /**
    * @notice Allow users to swap tokens for Ether
    */
    function swapTokens(uint256 amountOfToken) external {
        require(amountOfToken > 0, "Amount of tokens must be greater than zero");

        // Calculate how much Ether the user will receive
        uint256 amountInEther = (amountOfToken * 1e18) / exchangeRate;

        // Check if the Vendor Contract has enough Ether for the transaction
        uint256 contractBalance = address(this).balance;
        require(contractBalance >= amountInEther, "Vendor contract does not have enough Ether");

        // Transfer tokens from the user to the Vendor contract
        bool received = token.transferFrom(msg.sender, address(this), amountOfToken);
        require(received, "Failed to transfer tokens to the contract");

        // Transfer Ether to the user
        (bool sent, ) = msg.sender.call{value: amountInEther}("");
        require(sent, "Failed to send Ether to the user");

        // Emit the event
        emit Swap(msg.sender, amountOfToken, amountInEther);
    }

    /**
    * @notice Allow the owner of the contract to withdraw Ether
    */
    function withdraw() public onlyOwner {
        uint256 ownerBalance = address(this).balance;
        require(ownerBalance > 0, "No balance to withdraw");

        (bool sent, ) = msg.sender.call{value: ownerBalance}("");
        require(sent, "Failed to send Ether to the owner");
    }

    /**
    * @notice Allow the owner to update the exchange rate
    */
    function updateExchangeRate(uint256 newRate) external onlyOwner {
        exchangeRate = newRate;
    }

    /**
    * @notice Allow the owner to withdraw tokens
    */
    function withdrawTokens() external onlyOwner {
        uint256 tokenBalance = token.balanceOf(address(this));
        if (tokenBalance > 0) {
            bool sent = token.transfer(msg.sender, tokenBalance);
            require(sent, "Failed to send tokens to the owner");
        }
    }
}

